        //                         <span>Home</span>
        //                     </li>
        //                 </a>

        //                 <a href='https://www.google.nl/'>
        //                     <li>
        //                         <span>Youtube-Tutorials</span>
        //                     </li>
        //                 </a>

        //                 <a href='https://www.google.nl/'>
        //                     <li>
        //                         <span>Instagram-Posts</span>
        //                     </li>
        //                 </a>

        //                 <a href='https://www.google.nl/'>
        //                     <li>
        //                         <span>Contact</span>
        //                     </li>
